func cmykProfilePath() (string, error) {
	if _cmykProfilePath == "" {
		cmykProfile, _ := base64.StdEncoding.DecodeString(strings.Replace(cmykProfile64, "\n", "", -1))

		f, err := ioutil.TempFile("", "")
		if err != nil {
			return "", err
		}

		f.Write(cmykProfile)
		f.Close()

		_cmykProfilePath = f.Name()
		log.Printf("CMYK profile was written to %v", _cmykProfilePath)
	}

	return _cmykProfilePath, nil
}
